(678, 'dopronb', 'Thứ nhất, quả sơn tra không phải là đặc sản duy nhất ở Sa Pa nó thường được trồng ở các tỉnh Tây Bắc khác nữa như Lai Châu, Yên Bái, Sơn La,...Trồng ở nơi có độ cao hơn 1000m so với mực nước biển, mọc tự nhiên hoang hóa trên rừng cao không có người chăm sóc.  Tiếng địa phương của nó là \" chi tô di \" tên gọi mà người dân tộc Mông nơi đây hay gọi, còn tê khoa học của nó là Docynia india Dec thuộc một trong các loại của họ Rosaceae ( Hoa hồng ).  Về đặc điểm hình dáng và kích thước, nó là loại cây vừa với chiều cao trung bình khoảng từ 6-7m, khi cây còn non nó có tán lá đa dạng thường mọc dưới dạng so le nhau. Lá của cây táo mèo thường xẻ từ ba đến bốn thùy, có răng cưa xung quanh không đều nhau. Còn với loại cây trưởng thành là dài từ 6-9 cm, hình bầu dục, rộng từ 3-5 cm, mép khía răng ít.  Đến tháng ba là mùa ra hoa, trên cây tràn ngập những một màu trắng của những cánh hoa từ ba đến bốn cánh, nhị vàng với số lượng từ 30-40 nhị. Tầm tháng 7- 11 là mùa quả, với hình dáng hình cầu, kích thước đa dạng từ 3-4cm gọi là táo bi và 6-7cm gọi là táo to, khi trái chín có màu hồng phấn hoặc vàng trong, mùi rất thơm và ăn có vị chua chua chát chát.  Đến mùa thu hoạch, người dân tộc nơi đây đi thu gom quả chín ở trong rừng già đem bán cho lái buôn hoặc xuất sang Trung Quốc để làm thuốc.', '', '0000-00-00 00:00:00'),
