(2506, 'sungmin', 'Anh trai cute đáng yêu cười tỏa nắng. Nhưng mà ảnh có vợ rồi. Sim tiếc lắm. Dù Sim muốn các anh đi lấy vợ rồi còn sinh mấy tiểu yêu, nhưng Sim vẫn tiếc lắm huhu. Yêu anh lắm Sungmin ahhh ', '', '0000-00-00 00:00:00'),
(2507, 'Shindong', 'Anh béo cute đáng yêu. Mặc dù là hơi hơi cộc, nhưng anh tốt bụng với cả hiền lành cực ^^ Sim yêu anh ', '', '0000-00-00 00:00:00'),
(2508, 'Eunhyuk', 'Vợ con cá ngố tàu. Con cá ngố suốt ngày bám vợ, còn vợ chỉ thể hiện tình yêu kín kẽ chứ hông có lố như con cá. Nhưng mà ông vợ ổng skinship với con cá ngố suốt ngày thoai ^^ Sim yêu vợ chồng này lắm ý', '', '0000-00-00 00:00:00'),
(2509, 'Donghae', 'Con cá ngố là chồng yêu của ông vợ Eunhyuk:)) Bám vợ skinship vợ bất cứ khi nào có thể. Hai vợ chồng này lúc nào cũng quấn quít nhau. Cứ để ý trong mấy MV thì lúc nào cũng đứng gần nhau. Con cá ngố hát câu nào thì y như rằng câu sau là của ông vợ và ngược lại :)) Không bao giờ tách rời nhau được  ', '', '0000-00-00 00:00:00'),
(2510, 'Kangin', 'Là papa yêu thương <3 Là người luôn đứng đằng sau SJ. Anh yêu SJ không qua lời nói ngọt ngào, mà từng hành động anh làm. Có vài lần anh phạm lỗi, anh tự biết hối lỗi và chuộc tội rất là chân thực. Sim yêu anh, yêu appa <3 ', '', '0000-00-00 00:00:00'),
(2511, 'Heechul', 'Ngôi sao vũ trụ Kim Heechul. Đẹp trai ngời ngời từ bé tí. Hát hay. Anh nhảy không giỏi nhưng anh luôn biết cố gắng và phấn đấu <3 Anh luôn khiến Sim cười trong các show mà anh tham gia. Có anh là có tiếng cười, hạnh phúc ngập tràn <3 Yêu anh nhiều lắm Chulie ahhhh ', '', '0000-00-00 00:00:00'),
(2512, 'Mày biết Super Junior hông', 'Sim là ELF lâu năm ròi đó nha :)) Hông dỡn được với Sim đâu nha. Hỏi đi Sim trả lời được hết nha :)))', '', '0000-00-00 00:00:00'),
(2513, 'Kyuhyun', 'Em út ranh mã láu cá :v Ảnh láu lắm luôn. Ảnh hát hay lắm luôn. Ảnh cười đẹp lắm luôn', '', '0000-00-00 00:00:00'),
