(6749, 'Ten la j', 'SímBài hát: Áo Mới Cà Mau Sáng tác: Thanh Sơn Trình bày: Phi Nhung  Nghe nói Cà Mau xa lắm, ở cuối cùng bản đồ Việt Nam. Ngại chi đường xa không tới, về để nói với nhau mấy lời. Xuôi máy chèo sông ông Đốc, đêm trắng kịp tới chợ Cà Mau. Xuồng ghe ngày đêm không ngớt, người Cà Mau dễ thương vô cùng.  Về Cái Nước, Đầm Dơi, nghe ai ru câu ơi hời. Thương em đừng để duyên lỡ thời, tội nghiệp ghê nghe sắc se con tim tôi. Chừng nào về Năm Căn, nhớ nhau qua lại cũng gần. Một lần về U Minh, nghe muỗi kêu nhớ rừng Cà Mau.  Mai mốt Cà Mau em lớn, tuy út mà \"sửa soạn\" đẹp hơn. Cà Mau đường đi không khó, mà chỉ khó có sông vắng đò. Em đứng mình ên một hướng, duyên dáng mời khách lạ ngàn phương. Cà Mau mặc thêm áo mới, về Cà Mau là thấy thương em rồi.  Gió xuân bay về Cà Mau qua Đầm Dơi nước sông lững lờ bông tràm thoảng đưa mùi hương.  Mong anh đến rừng U Minh, cảnh quan bao tình, khung trời đẹp xinh, lá hoa điểm tô trời xuân. Chúng mình về vùng Năm Căn cùng lắng nghe khúc ca bình minh. Tiếng hò dìu dặt xa đưa dòng sông nước trôi sóng xô con đò. Để chúng mình giả từ cùng nhau, lưu luyến bao ân tình khung trời Cà Mau.  Về Cái Nước, Đầm Dơi, nghe ai ru câu ơi hời. Thương em đừng để duyên lỡ thời, tội nghiệp ghê nghe sắc se con tim tôi. Chừng nào về Năm Căn, nhớ nhau qua lại cũng gần. Một lần về U Minh, nghe muỗi kêu nhớ rừng Cà Mau. Mai mốt Cà Mau em lớn, tuy út mà \"sửa soạn\" đẹp hơn. Cà Mau đường đi không khó, mà chỉ khó có sông vắng đò. Em đứng mình ên một hướng, duyên dáng mời khách lạ ngàn phương. Cà Mau mặc thêm áo mới, về Cà Mau là thấy thương em rồi. Cà Mau mặc thêm áo mới, về Cà Mau... là thấy thương em rồi.. ..imi', '', '0000-00-00 00:00:00'),
